INSERT INTO `dhh_article` VALUES ('1', 'about', '关于我们', '东华行\n\n\n\n\n     电话');
INSERT INTO `dhh_article` VALUES ('2', 'law', '法律条款', '<p style=\"text-indent:238px\"><span style=\"font-family:宋体\">法律条款</span></p><p><strong><span style=\"font-size:10px;font-family:宋体;color:#666666\">一、定义</span></strong></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">用户，包含注册用户和非注册用户。注册用户是指通过东华行平台完成全部注册流程后，使用东华行平台服务的用户。非注册用户是指未进行注册、直接访问使用东华行平台服务的用户。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">协议方，中山市东华行物流公司通过东华行物流软件为用户提供服务。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p><strong><span style=\"font-size:10px;font-family:宋体;color:#666666\">二、目的</span></strong></p><p style=\"text-indent: 32px\"><span style=\"font-size: 16px;font-family:宋体;color:#666666\">为商户和物流公司提供信息上的便利。</span></p><p><strong><span style=\"font-size:10px;font-family:宋体;color:#666666\">三、遵守法律及法律效力</span></strong></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">本服务协议在向用户公告后，开始提供服务或以其他方式向用户提供服务同时产生法律效力。用户同意遵守《中华人民共和国保密法》、《计算机信息系统国际联网保密管理规定》、《中华人民共和国计算机信息系统安全保护条例》、《计算机信息网络国际联网安全保护管理办法》、《中华人民共和国计算机信息网络国际联网管理暂行规定》及其实施办法等相关法律法规的任何及所有的规定，并对用户以任何方式使用服务的任何行为及其结果承担全部责任。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">在任何情况下，如果本网站合理地认为用户的任何行为，包括但不限于用户的任何言论和其他行为违反或可能违反上述法律和法规的任何规定，本平台可在任何时候不经任何事先通知终止向用户提供服务。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">本平台可能不时的修改有关条款内容，一旦条款内容发生变动，本平台将会在相关的页面发布修改内容。在更改此使用服务协议时，本平台将说明更改内容的执行日期，变更理由等，一经正式发布即生效。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p><strong><span style=\"font-size:10px;font-family:宋体;color:#666666\">四、服务内容</span></strong></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">东华行的具体内容由本平台根据实际情况提供，本网站保留随时变更、中断或终止部分或全部东华行物流服务的权利。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p><strong><span style=\"font-size:10px;font-family:宋体;color:#666666\">五、用户的义务</span></strong></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">用户在申请使用本网站服务时，必须向本网站提供准确的个人有关资料，如资料有任何变动，必须及时更新。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">用户注册成功后，本平台将给予每个用户一个用户帐号及相应的密码，该用户帐号和密码由用户负责保管；用户应当对以其用户帐号进行的所有活动和事件负法律责任。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">用户在使用本网站网络服务过程中，必须遵循以下原则：</span></p><p style=\"margin-left: 0;text-indent: 32px;line-height: 20px\"><span style=\"font-size:13px;font-family:Symbol;color:#666666\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16px;font-family:宋体;color:#666666\">遵守中国有关的法律和法规；</span></p><p style=\"margin-left: 0;text-indent: 32px;line-height: 20px\"><span style=\"font-size:13px;font-family:Symbol;color:#666666\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16px;font-family:宋体;color:#666666\">不得为任何非法目的而使用网络服务系统；</span></p><p style=\"margin-left: 0;text-indent: 32px;line-height: 20px\"><span style=\"font-size:13px;font-family:Symbol;color:#666666\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16px;font-family:宋体;color:#666666\">遵守所有与网络服务有关的网络协议、规定和程序；</span></p><p style=\"margin-left: 0;text-indent: 32px;line-height: 20px\"><span style=\"font-size:13px;font-family:Symbol;color:#666666\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16px;font-family:宋体;color:#666666\">不得利用东华行物流服务系统传输任何危害社会，侵蚀道德风尚，宣传不法宗教组织等内容；</span></p><p style=\"margin-left: 0;text-indent: 32px;line-height: 20px\"><span style=\"font-size:13px;font-family:Symbol;color:#666666\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16px;font-family:宋体;color:#666666\">不得利用东华行物流服务系统进行任何可能对互联网的正常运转造成不利影响的行为；</span></p><p style=\"margin-left: 0;text-indent: 32px;line-height: 20px\"><span style=\"font-size:13px;font-family:Symbol;color:#666666\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16px;font-family:宋体;color:#666666\">不得利用东华行物流服务系统上载、张贴或传送任何非法、有害、胁迫、滥用、骚扰、侵害、中伤、粗俗、猥亵、诽谤、侵害他人隐私、辱骂性的、恐吓性的、庸俗淫秽的及有害或种族歧视的或道德上令人不快的包括其他任何非法的信息资料；</span></p><p style=\"margin-left: 0;text-indent: 32px;line-height: 20px\"><span style=\"font-size:13px;font-family:Symbol;color:#666666\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16px;font-family:宋体;color:#666666\">不得利用东华行物流服务系统进行任何不利于本网站的行为；</span></p><p style=\"margin-left: 0;text-indent: 32px;line-height: 20px\"><span style=\"font-size:13px;font-family:Symbol;color:#666666\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16px;font-family:宋体;color:#666666\">如发现任何非法使用用户帐号或帐号出现安全漏洞的情况，应立即通告本平台。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p><strong><span style=\"font-size:10px;font-family:宋体;color:#666666\">六、本平台的权利及义务</span></strong></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">本平台除特殊情况外（例如：协助公安等相关部门调查破案等），致力于努力保护用户的个人资料不被外泄，且不得在未经本人的同意下向第三者提供用户的个人资料。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">本平台根据提供服务的过程，经营上的变化，无需得到用户同意即可更改、变更所提供服务的内容。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">本平台在提供服务过程中，应及时解决用户提出的不满事宜，如在解决过程中确有难处，可以采取公开通知方式或向用户发送电子邮件寻求解决办法。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">本网站在下列情况下可以不通过向用户通知，直接删除其上载的内容：</span></p><p style=\"margin-left: 0;text-indent: 32px;line-height: 20px\"><span style=\"font-size:13px;font-family:Symbol;color:#666666\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16px;font-family:宋体;color:#666666\">有损于本网站，用户或第三者名誉的内容；</span></p><p style=\"margin-left: 0;text-indent: 32px;line-height: 20px\"><span style=\"font-size:13px;font-family:Symbol;color:#666666\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16px;font-family:宋体;color:#666666\">利用东华行物流服务系统上载、张贴或传送任何非法、有害、胁迫、滥用、骚扰、侵害、中伤、粗俗、猥亵、诽谤、侵害他人隐私、辱骂性的、恐吓性的、庸俗淫秽的及有害或种族歧视的或道德上令人不快的包括其他任何非法的内容；</span></p><p style=\"margin-left: 0;text-indent: 32px;line-height: 20px\"><span style=\"font-size:13px;font-family:Symbol;color:#666666\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16px;font-family:宋体;color:#666666\">侵害本网站或第三者的版权，著作权等内容；</span></p><p style=\"margin-left: 0;text-indent: 32px;line-height: 20px\"><span style=\"font-size:13px;font-family:Symbol;color:#666666\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16px;font-family:宋体;color:#666666\">存在与本网站提供的服务无关的内容；</span></p><p style=\"margin-left: 0;text-indent: 32px;line-height: 20px\"><span style=\"font-size:13px;font-family:Symbol;color:#666666\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16px;font-family:宋体;color:#666666\">无故盗用他人的</span><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#666666\">ID(</span><span style=\"font-size:16px;font-family:宋体;color:#666666\">固有用户名</span><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#666666\">)</span><span style=\"font-size:16px;font-family:宋体;color:#666666\">、姓名上载、张贴或传送任何内容及恶意更改，伪造他人上载内容。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p><strong><span style=\"font-size:10px;font-family:宋体;color:#666666\">七、知识产权声明</span></strong></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">本平台所有的产品、技术与所有程序及页面（包括但不限于页面设计及内容）均属于知识产权，仅供个人学习、研究和欣赏，未经授权，任何人不得擅自使用，否则，将依法追究法律责任。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">广州靖凯网络科技有限公司拥有本网站内所有资料（包括但不限于本站所刊载的图片、视频、</span><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#666666\">Flash</span><span style=\"font-size:16px;font-family:宋体;color:#666666\">等）的版权，（版权归属有特殊约定的，从其约定），未经授权，任何人不得擅自使用，否则，将依法追究法律责任。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p><strong><span style=\"font-size:10px;font-family:宋体;color:#666666\">八、免责声明</span></strong></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">任何人因使用本平台而可能遭致的意外及其造成的损失（包括因下载本网站可能链接的第三方网站内容而感染电脑病毒），我们对此概不负责，亦不承担任何法律责任。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">本网站禁止制作、复制、发布、传播等具有反动、色情、暴力、淫秽等内容的信息，一经发现，立即删除。若您因此触犯法律，我们对此不承担任何法律责任。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">本网站用户自行上传或通过网络收集的资源，我们仅提供一个展示、交流的平台，不对其内容的准确性、真实性、正当性、合法性负责，也不承担任何法律责任。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">任何单位或个人认为通过本网站网页内容可能涉嫌侵犯其著作权，应该及时向我们提出书面权利通知，并提供身份证明、权属证明及详细侵权情况证明。我们收到上述法律文件后，将会依法尽快处理。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p><strong><span style=\"font-size:10px;font-family:宋体;color:#666666\">九、服务变更、中断或终止</span></strong></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">如因系统维护或升级的需要而需暂停易物流服务，本网站将尽可能事先进行通告。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">如发生下列任何一种情形，本网站有权随时中断或终止向用户提供本协议项下的东华行物流服务而无需通知用户：</span></p><p style=\"margin-left: 0;text-indent: 32px;line-height: 20px\"><span style=\"font-size:13px;font-family:Symbol;color:#666666\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16px;font-family:宋体;color:#666666\">用户提供的个人资料不真实；</span></p><p style=\"margin-left: 0;text-indent: 32px;line-height: 20px\"><span style=\"font-size:13px;font-family:Symbol;color:#666666\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16px;font-family:宋体;color:#666666\">用户违反本协议中规定的使用规则。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">除前款所述情形外，本平台同时保留在不事先通知用户的情况下随时中断或终止部分或全部易物流服务的权利，对于所有服务的中断或终止而造成的任何损失，本平台无需对用户或任何第三方承担任何责任。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p><strong><span style=\"font-size:10px;font-family:宋体;color:#666666\">十、违约赔偿</span></strong></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">用户同意保障和维护本网站及其他用户的利益，如因用户违反有关法律、法规或本协议项下的任何条款而给本网站或任何其他第三方造成损失，用户同意承担由此造成的损害赔偿责任。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p><strong><span style=\"font-size:10px;font-family:宋体;color:#666666\">十一、法律管辖</span></strong></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">本协议的订立、执行和解释及争议的解决均应适用中国法律。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">如双方就本协议内容或其执行发生任何争议，双方应尽量友好协商解决；协商不成时，任何一方均可向本平台所在地的人民法院提起诉讼。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p><strong><span style=\"font-size:10px;font-family:宋体;color:#666666\">十二、其他规定</span></strong></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">本协议构成双方对本协议之约定事项及其他有关事宜的完整协议，除本协议规定的之外，未赋予本协议各方其他权利。</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 32px;line-height: 20px\"><span style=\"font-size:16px;font-family:宋体;color:#666666\">如本协议中的任何条款无论因何种原因完全或部分无效或不具有执行力，本协议的其余条款仍应有效并且有约束力。</span></p><p><br/></p>');
INSERT INTO `dhh_article` VALUES ('3', 'suggest', '给我们建议', '<p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 你好，这是东华行平台</p><p style=\"white-space: normal;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 如您有什么好的建议请联系我们；</p><p><br/></p>');
INSERT INTO `dhh_article` VALUES ('4', 'register', '注册协议', '<p style=\"white-space: normal; text-indent: 238px;\"><span style=\"font-family: 宋体;\">注册协议</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 10px; font-family: 宋体; color: rgb(102, 102, 102);\">一、定义</span></strong></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">用户，包含注册用户和非注册用户。注册用户是指通过东华行平台完成全部注册流程后，使用东华行平台服务的用户。非注册用户是指未进行注册、直接访问使用东华行平台服务的用户。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">协议方，中山市东华行物流公司通过东华行物流软件为用户提供服务。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 10px; font-family: 宋体; color: rgb(102, 102, 102);\">二、目的</span></strong></p><p style=\"white-space: normal; text-indent: 32px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">为商户和物流公司提供信息上的便利。</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 10px; font-family: 宋体; color: rgb(102, 102, 102);\">三、遵守法律及法律效力</span></strong></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">本服务协议在向用户公告后，开始提供服务或以其他方式向用户提供服务同时产生法律效力。用户同意遵守《中华人民共和国保密法》、《计算机信息系统国际联网保密管理规定》、《中华人民共和国计算机信息系统安全保护条例》、《计算机信息网络国际联网安全保护管理办法》、《中华人民共和国计算机信息网络国际联网管理暂行规定》及其实施办法等相关法律法规的任何及所有的规定，并对用户以任何方式使用服务的任何行为及其结果承担全部责任。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">在任何情况下，如果本网站合理地认为用户的任何行为，包括但不限于用户的任何言论和其他行为违反或可能违反上述法律和法规的任何规定，本平台可在任何时候不经任何事先通知终止向用户提供服务。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">本平台可能不时的修改有关条款内容，一旦条款内容发生变动，本平台将会在相关的页面发布修改内容。在更改此使用服务协议时，本平台将说明更改内容的执行日期，变更理由等，一经正式发布即生效。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 10px; font-family: 宋体; color: rgb(102, 102, 102);\">四、服务内容</span></strong></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">东华行的具体内容由本平台根据实际情况提供，本网站保留随时变更、中断或终止部分或全部东华行物流服务的权利。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 10px; font-family: 宋体; color: rgb(102, 102, 102);\">五、用户的义务</span></strong></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">用户在申请使用本网站服务时，必须向本网站提供准确的个人有关资料，如资料有任何变动，必须及时更新。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">用户注册成功后，本平台将给予每个用户一个用户帐号及相应的密码，该用户帐号和密码由用户负责保管；用户应当对以其用户帐号进行的所有活动和事件负法律责任。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">用户在使用本网站网络服务过程中，必须遵循以下原则：</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-size: 13px; font-family: Symbol; color: rgb(102, 102, 102);\">·<span style=\"font-stretch: normal; font-size: 9px; line-height: normal; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">遵守中国有关的法律和法规；</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-size: 13px; font-family: Symbol; color: rgb(102, 102, 102);\">·<span style=\"font-stretch: normal; font-size: 9px; line-height: normal; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">不得为任何非法目的而使用网络服务系统；</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-size: 13px; font-family: Symbol; color: rgb(102, 102, 102);\">·<span style=\"font-stretch: normal; font-size: 9px; line-height: normal; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">遵守所有与网络服务有关的网络协议、规定和程序；</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-size: 13px; font-family: Symbol; color: rgb(102, 102, 102);\">·<span style=\"font-stretch: normal; font-size: 9px; line-height: normal; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">不得利用东华行物流服务系统传输任何危害社会，侵蚀道德风尚，宣传不法宗教组织等内容；</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-size: 13px; font-family: Symbol; color: rgb(102, 102, 102);\">·<span style=\"font-stretch: normal; font-size: 9px; line-height: normal; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">不得利用东华行物流服务系统进行任何可能对互联网的正常运转造成不利影响的行为；</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-size: 13px; font-family: Symbol; color: rgb(102, 102, 102);\">·<span style=\"font-stretch: normal; font-size: 9px; line-height: normal; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">不得利用东华行物流服务系统上载、张贴或传送任何非法、有害、胁迫、滥用、骚扰、侵害、中伤、粗俗、猥亵、诽谤、侵害他人隐私、辱骂性的、恐吓性的、庸俗淫秽的及有害或种族歧视的或道德上令人不快的包括其他任何非法的信息资料；</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-size: 13px; font-family: Symbol; color: rgb(102, 102, 102);\">·<span style=\"font-stretch: normal; font-size: 9px; line-height: normal; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">不得利用东华行物流服务系统进行任何不利于本网站的行为；</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-size: 13px; font-family: Symbol; color: rgb(102, 102, 102);\">·<span style=\"font-stretch: normal; font-size: 9px; line-height: normal; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">如发现任何非法使用用户帐号或帐号出现安全漏洞的情况，应立即通告本平台。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 10px; font-family: 宋体; color: rgb(102, 102, 102);\">六、本平台的权利及义务</span></strong></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">本平台除特殊情况外（例如：协助公安等相关部门调查破案等），致力于努力保护用户的个人资料不被外泄，且不得在未经本人的同意下向第三者提供用户的个人资料。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">本平台根据提供服务的过程，经营上的变化，无需得到用户同意即可更改、变更所提供服务的内容。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">本平台在提供服务过程中，应及时解决用户提出的不满事宜，如在解决过程中确有难处，可以采取公开通知方式或向用户发送电子邮件寻求解决办法。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">本网站在下列情况下可以不通过向用户通知，直接删除其上载的内容：</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-size: 13px; font-family: Symbol; color: rgb(102, 102, 102);\">·<span style=\"font-stretch: normal; font-size: 9px; line-height: normal; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">有损于本网站，用户或第三者名誉的内容；</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-size: 13px; font-family: Symbol; color: rgb(102, 102, 102);\">·<span style=\"font-stretch: normal; font-size: 9px; line-height: normal; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">利用东华行物流服务系统上载、张贴或传送任何非法、有害、胁迫、滥用、骚扰、侵害、中伤、粗俗、猥亵、诽谤、侵害他人隐私、辱骂性的、恐吓性的、庸俗淫秽的及有害或种族歧视的或道德上令人不快的包括其他任何非法的内容；</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-size: 13px; font-family: Symbol; color: rgb(102, 102, 102);\">·<span style=\"font-stretch: normal; font-size: 9px; line-height: normal; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">侵害本网站或第三者的版权，著作权等内容；</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-size: 13px; font-family: Symbol; color: rgb(102, 102, 102);\">·<span style=\"font-stretch: normal; font-size: 9px; line-height: normal; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">存在与本网站提供的服务无关的内容；</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-size: 13px; font-family: Symbol; color: rgb(102, 102, 102);\">·<span style=\"font-stretch: normal; font-size: 9px; line-height: normal; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">无故盗用他人的</span><span style=\"font-family: Arial, sans-serif; color: rgb(102, 102, 102);\">ID(</span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">固有用户名</span><span style=\"font-family: Arial, sans-serif; color: rgb(102, 102, 102);\">)</span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">、姓名上载、张贴或传送任何内容及恶意更改，伪造他人上载内容。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 10px; font-family: 宋体; color: rgb(102, 102, 102);\">七、知识产权声明</span></strong></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">本平台所有的产品、技术与所有程序及页面（包括但不限于页面设计及内容）均属于知识产权，仅供个人学习、研究和欣赏，未经授权，任何人不得擅自使用，否则，将依法追究法律责任。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">广州靖凯网络科技有限公司拥有本网站内所有资料（包括但不限于本站所刊载的图片、视频、</span><span style=\"font-family: Arial, sans-serif; color: rgb(102, 102, 102);\">Flash</span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">等）的版权，（版权归属有特殊约定的，从其约定），未经授权，任何人不得擅自使用，否则，将依法追究法律责任。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 10px; font-family: 宋体; color: rgb(102, 102, 102);\">八、免责声明</span></strong></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">任何人因使用本平台而可能遭致的意外及其造成的损失（包括因下载本网站可能链接的第三方网站内容而感染电脑病毒），我们对此概不负责，亦不承担任何法律责任。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">本网站禁止制作、复制、发布、传播等具有反动、色情、暴力、淫秽等内容的信息，一经发现，立即删除。若您因此触犯法律，我们对此不承担任何法律责任。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">本网站用户自行上传或通过网络收集的资源，我们仅提供一个展示、交流的平台，不对其内容的准确性、真实性、正当性、合法性负责，也不承担任何法律责任。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">任何单位或个人认为通过本网站网页内容可能涉嫌侵犯其著作权，应该及时向我们提出书面权利通知，并提供身份证明、权属证明及详细侵权情况证明。我们收到上述法律文件后，将会依法尽快处理。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 10px; font-family: 宋体; color: rgb(102, 102, 102);\">九、服务变更、中断或终止</span></strong></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">如因系统维护或升级的需要而需暂停易物流服务，本网站将尽可能事先进行通告。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">如发生下列任何一种情形，本网站有权随时中断或终止向用户提供本协议项下的东华行物流服务而无需通知用户：</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-size: 13px; font-family: Symbol; color: rgb(102, 102, 102);\">·<span style=\"font-stretch: normal; font-size: 9px; line-height: normal; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">用户提供的个人资料不真实；</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-size: 13px; font-family: Symbol; color: rgb(102, 102, 102);\">·<span style=\"font-stretch: normal; font-size: 9px; line-height: normal; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">用户违反本协议中规定的使用规则。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">除前款所述情形外，本平台同时保留在不事先通知用户的情况下随时中断或终止部分或全部易物流服务的权利，对于所有服务的中断或终止而造成的任何损失，本平台无需对用户或任何第三方承担任何责任。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 10px; font-family: 宋体; color: rgb(102, 102, 102);\">十、违约赔偿</span></strong></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">用户同意保障和维护本网站及其他用户的利益，如因用户违反有关法律、法规或本协议项下的任何条款而给本网站或任何其他第三方造成损失，用户同意承担由此造成的损害赔偿责任。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 10px; font-family: 宋体; color: rgb(102, 102, 102);\">十一、法律管辖</span></strong></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">本协议的订立、执行和解释及争议的解决均应适用中国法律。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">如双方就本协议内容或其执行发生任何争议，双方应尽量友好协商解决；协商不成时，任何一方均可向本平台所在地的人民法院提起诉讼。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 10px; font-family: 宋体; color: rgb(102, 102, 102);\">十二、其他规定</span></strong></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">本协议构成双方对本协议之约定事项及其他有关事宜的完整协议，除本协议规定的之外，未赋予本协议各方其他权利。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 20px;\"><span style=\"font-family: 宋体; color: rgb(102, 102, 102);\">如本协议中的任何条款无论因何种原因完全或部分无效或不具有执行力，本协议的其余条款仍应有效并且有约束力。</span></p><p><br/></p>');
